- Crafting hidden images in someone else's yard or even on walls throughout the city; 
- Sneaking an invisible dye into somebody’s favorite soft drink so that whenever they finish the bottle, the entire label turns completely blue.   All these pranks will be sure to leave your friends surprised and amused!

